const Footer = (() => {

  return (
    <section className="footer">
      <nav className="footerNav">
        <div className="logoBar">
          <Logo />
        </div>
        <div className="navLinks">
          <NavLink to="/#aboutSection" className="navLink">
            О проекте
          </NavLink>

          <NavLink to="/#howItWorksSection" className="navLink">
            Как это работает
          </NavLink>
        </div>
      </nav>
      <div className="copyRightBlock">
        <p className="copyRight">&copy; 2024 Давай поговорим</p>
      </div>
    </section>
  );
});

export default Footer;
